import Vue from 'vue'
import Router from 'vue-router'
import Home from './views/Home/Home.vue'

Vue.use(Router)
export default new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes: [{
    path: '*',
    redirect: {
      path: '/',
      component: Home,
    },
  },
  {
    path: '/',
    name: 'home',
    // component: Home,
    component: () => import('./views/Home/Home.vue'),
  },
  {
    path: '/customer',
    name: 'customer',
    // 客户管理
    component: () => import('./views/customerManagement/customer.vue'),
  },
  {
    path: '/addContact',
    name: 'addContact',
    component: () => import('./views/addContact/addContact.vue'),
  },
  {
    path: '/addCustomer',
    name: 'addCustomer',
    component: () => import('./views/addCustomer/addCustomer.vue'),
    beforeRouteLeave: () => {
      // ...
    },
  },
  {
    path: '/addCooperation',
    name: 'addCooperation',
    component: () => import('./views/addCooperation/addCooperation.vue'),
  },
  {
    path: '/addVisit',
    name: 'addVisit',
    component: () => import('./views/addVisit/addVisit.vue'),
  },
  {
    path: '/addApproval',
    name: 'addApproval',
    component: () => import('./views/addApproval/addApproval.vue'),
  },
  {
    path: '/addQuotation',
    name: 'addQuotation',
    component: () => import('./views/addQuotation/addQuotation.vue'),
  },
  {
    path: '/addSign',
    name: 'addSign',
    component: () => import('./views/addSign/addSign.vue'),
  },
  {
    path: '/addInvestigation',
    name: 'addInvestigation',
    component: () => import('./views/addInvestigation/addInvestigation.vue'),
  },
  {
    path: '/addCommerce',
    name: 'addCommerce',
    component: () => import('./views/addCommerce/addCommerce.vue'),
  },
  {
    path: '/addLoan',
    name: 'addLoan',
    component: () => import('./views/addLoan/addLoan.vue'),
  },
  {
    path: '/afterLoan',
    name: 'afterLoan',
    component: () => import('./views/AfterLoanManagement/afterLoan.vue'),
  },
  {
    path: '/addRepayment',
    name: 'addRepayment',
    component: () => import('./views/addRepayment/addRepayment.vue'),
  },
  {
    path: '/test',
    name: 'test',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    //  ! 懒加载
    component: () => import(/* webpackChunkName: "test" */ './views/Test.vue'),
  },
  ],
})
